Our self-adhesive vinyl stickers adhere to a wide variety of surfaces such as smooth walls, glass, mirrors, doors, sheets, laminated wood, 
vehicles.

WE CAN SUPPLY THE ARTWOR IN DIGITAL FOR YOU USE ANY TIME, HOW MANY TIMES YOU WANT AND WHEREVER YOU WANT. YOU CAN PRINT IN A T-SHIRT/MOUSE PAD/DO A POSTER BESIDE YOUR HOME. YOU DON&#39;T NEED TO WAIT FOR US, IF YOU PREFER ORDER DIGITAL FILE AND GET HI RES FILE!

For better adhesion and duration of your product you must take into account the following points:

* Surface completely free of grease and dust (regardless of appearance, always clean);
* After the last painting of the wall/surface you must wait between 2 to 3 weeks to apply the vinyl;
* Completely smooth surface (swipe to feel if there is no texture);
* Silicone-free surface or oil-based paint;
* This can be applied to many items to personalize for a professional look/finish;
* The item needs to have a smooth and non-porous surface;
* So, it can be applied to glass, paper, plastic, metal, and wood.

IF YOU REQUIRE SOMETHING BESPOKE THEN PLEASE FEEL FREE TO GET IN TOUCH

The stickers are printed and cut from high-quality vinyl. They are cut and the excess removed. For multiple orders add to the basket for combined postage on your order on multiple item.

The stickers are easy to remove but not reusable.

They are suitable for interior or exterior use on any clean and smooth surfaces. Not suitable for silk or gloss painted surface.

For freshly painted surfaces allow at least 5 weeks for you to apply.

To remove all stickers we would advise using a hairdryer at a low heat setting to allow the glue to moisten for smooth and easy removal.
